import React, { Component } from 'react';
import {TextInput} from 'react-materialize'
class Login extends Component {
    render() {
        return <div>
            <form method="POST">
                <TextInput email label="Email" validate />
                <TextInput label="Password" password />
            </form>
        </div>
    }
}
export default Login
